INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (2.1, -416.5, 0.0, 2, "ヤマト", 3001100, 100, 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3001, 130011, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
